actionConfiguration.body:
country => {
  let averages = Data.GetUsersOfCountry("Portugal").map(u => {
    let sum = 0, n = 0;
    u.Averages.forEach(a => {
      if (a.Sum !== 0) {
        sum += a.Sum;
        n++;
      }
    });
    return sum / n;
  }).filter(s => s).sort().reverse();
  let sum = 0;
  averages.forEach(a => sum += a);
  return sum / averages.length;
}

